import React, { Component } from 'react';
import 'antd/dist/antd.css';

import CustomLayout from './containers/Layout';

class App extends Component {
  render() {
    return (
      <div className="App">
        <CustomLayout>
          Hello
        </CustomLayout>
      </div>
    );
  }
}

export default App;
